import React, { Component } from 'react'

export default class TransactionsPage extends Component {
    state={
        currentUser: '',
        transactions:{}
    }
    render() {
        return (
            <div>
                <h2>{this.props.currentUser.name}'s Transactions</h2>
            </div>
        )
    }
}
